static void invoke_player_command(int NCode, int Id)
{
	printf("[%s] id=%d, NCode=%d, \n", __func__, Id, NCode);		
	if ( NCode == WM_NOTIFICATION_CLICKED )
	{
		switch (Id)
		{
			case ID_IMAGE_0://Next
				player_next();
				break;
			case ID_IMAGE_1://Previous
				player_previous();
				break;
			case ID_IMAGE_2://Play
				player_play();
			break;
			case ID_IMAGE_3://Stop
				player_pause();
			break;
		}
	}
}

static void play_first_media(void)
{
	printf("[%s]\n", __func__);
	player_start();
	player_play();
}

